  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The National Violent Death Reporting
  System (NVDRS) provides states and communities with a clearer understanding of violent
  deaths to guide local decisions about efforts to prevent violence and helps them
  track progress over time.</p>n<p>To stop violent deaths, we must first understand
  all the facts. Created in 2002, the NVDRS is a surveillance system that pulls together
  data on violent deaths in 18 states (see map below), including information about
  homicides, such as homicides perpetrated by a intimate partner (e.g., boyfriend,
  girlfriend, wife, husband), child maltreatment (or child abuse) fatalities, suicides,
  deaths where individuals are killed by law enforcement in the line of duty, unintentional
  firearm injury deaths, and deaths of undetermined intent.</p>n<p>These data are
  supported by WISQARS, an interactive query system that provides data on injury deaths,
  violent deaths, and nonfatal injuries.</p>n\",\n\t\"license_title\": \"Other License
